import React from 'react';
import classes from "./Navbar.module.css"

const Navbar = () => {
    return (
        <div className={classes.navbar}>
            <div className={classes.navbar__links}>
                <Link to="/user">account</Link>
                <Link to="/posts">posts</Link>
            </div>
        </div>
    )
}

export default Navbar
